import axios from "axios";
import {
  useEffect,
  useState,
} from "react";

interface Plants {
  data: [
    id: number,
    common_name: string,
    cycle: string,
    default_image: object
  ]
}

export default function PlantList(plants: Plants) {
  const [plantData, setPlantData] =
    useState();
  useEffect(() => {
    axios
      .get(
        " https://perenual.com/api/species-list?page=1&key=sk-dDOc645d08b22af9c865"
      )
      .then((response) =>
        console.log(response)
      );
  }, []);

  const { data, meta } =
    data || {};

  return <div>plants.data</div>;
}
